    TResult Function(_BleConnectivityInitial value)? bleConnectivityInitial,
    TResult Function(BleConnectivityConnected value)? bleConnectivityConnected,
    TResult Function(BleConnectivityDisconnected value)?
        bleConnectivityDisconnected,
    required TResult orElse(),
  }) {
    if (bleConnectivityDisconnected != null) {
      return bleConnectivityDisconnected(this);
    }
    return orElse();
  }
}

abstract class BleConnectivityDisconnected implements BleConnectivityState {
  const factory BleConnectivityDisconnected() =
      _$BleConnectivityDisconnectedImpl;
}
